import{_ as i,o as l,c as t,b as a}from"./chunks/framework.6c3c27db.js";const o="/assets/cover.16387a2d.jpg",r="/assets/warehouse.58795b7d.jpg",e="/assets/heaters.63dff0f7.jpg",k=JSON.parse('{"title":"Абама","description":"Прокат инструментов","frontmatter":{"title":"Абама","description":"Прокат инструментов","date":"2017-10-22","icon":"logo.png","cover":"enter.jpg","city":"г. Красноярск","address":"ул. Дудинская, 3/2","tel":"+7(391) 288-28-23","url":"https://prokatin.ru","email":"2882823@gmail.com","instagram":"prokatin.ru","vk":"prokatin_ru","hours":"ПН-ПТ 9:00 - 20:00 СБ-ВС 9:00 - 16:00","coord":[56.02618584374262,92.89634445609538],"status":"open"},"headers":[],"relativePath":"workshop/catalog/abama/index.md","filePath":"workshop/catalog/abama/index.md"}'),s={name:"workshop/catalog/abama/index.md"},n=a('<p>&quot;Абама - прокат&quot; предоставляет строительный инструмент и оборудование напрокат в Красноярске с 2009 года. За более чем 10 лет работы в прокате мы накопили большой опыт и склад инструмента и готовы предоставить нашим клиентам самые выгодные условия. На сайте prokatin.ru вы найдете полный перечень имеющегося инструмента и оборудования в наличии.</p><p>Предоставляя инструмент напрокат мы помогаем нашим партнерам:</p><ul><li>экономить деньги на приобретении оборудования для разовых работ</li><li>избавляем от хлопот по ремонту и уходу за инструментом</li><li>избавляем от затрат на аренду склада для хранения оборудования</li><li>даём возможность воспользоваться редким и специализированным оборудованием</li><li>поддерживаем экологическое движение по совместному пользованию вещами.</li></ul><p>В компании &quot;Абама - прокат инструмента и оборудования&quot; вы можете взять в аренду строительный инструмент и оборудование на выгодных и гибких условиях.</p><p>В нашем ассортименте представлено более 100 позиций садового и строительного инструмента в прокат. Для выполнения разнообразных задач мы предлагаем качественный профессиональный инструмент и оборудование.</p><p>Прокат инструмента даёт вам возможность выполнять качественную работу даже не имея своего оборудования, при этом экономя значительные средства и время.</p><p>Что бы взять инструмент напрокат необходимо обратиться в наш офис, оформить договор и внести оговоренный авансовый платеж, все это занимает не более пяти минут.</p><p><img src="'+o+'" alt=""></p><h3 id="для-физических-лиц" tabindex="-1">Для физических лиц <a class="header-anchor" href="#для-физических-лиц" aria-label="Permalink to &quot;Для физических лиц&quot;">​</a></h3><p><strong>Если вы решили воспользоваться услугами проката инструмента, вам необходимо:</strong></p><ol><li>позвонить нам и уточнить наличие нужного инструмента;</li><li>приехать к нам в офис и оформить договор (при себе иметь паспорт с пропиской в г. Красноярске);</li><li>внести <strong>авансовый платеж</strong> за пользование инструментом, вносится даже при наличии прописки в Красноярске;</li><li>получить инструмент у нас в офисе.</li></ol><ul><li><strong>Возможна аренда инструмента без документов</strong> - авансовый платеж 100% от стоимости инструмента.</li><li><strong>При заключении договора без паспорта</strong> (по водительскому удостоверению, загранпаспорту, паспорту иностранного гражданина и тд) - авансовый платеж 50% от полной стоимости инструмента.</li><li><strong>При отсутствии прописки в г. Красноярске</strong> - авансовый платеж 50% от полной стоимости инструмента.</li></ul><p><strong>Авансовый платеж</strong> - денежные средства внесенные в счет оплаты услуг до их получения или выполнения. Возврат инструмента необходимо произвести в оговоренные договором сроки. При возврате, инструмент проверяется на работоспособность и отсутствие внешних механических повреждений. Арендатор не несет ответственности за неисправности связанные с естественным износом инструмента. Весь инструмент принадлежит арендодателю. Внесение авансового платежа не означает передачу инструмента в постоянное пользование.</p><p><img src="'+r+'" alt=""></p><h3 id="для-юридических-лиц" tabindex="-1">Для юридических лиц <a class="header-anchor" href="#для-юридических-лиц" aria-label="Permalink to &quot;Для юридических лиц&quot;">​</a></h3><ol><li>позвонить нам и уточнить наличие нужного инструмента;</li><li>заключить договор аренды (необходимо предоставить реквизиты организации);</li><li>получить инструмент (требуется доверенность на получателя);</li><li>оплата производится после возврата инструмента.</li></ol><h2 id="каталог-оборудования" tabindex="-1">Каталог оборудования <a class="header-anchor" href="#каталог-оборудования" aria-label="Permalink to &quot;Каталог оборудования&quot;">​</a></h2><ul><li>Бензорезы, штроборезы, плиткорезы</li><li>Бетономешалки, миксеры, тачки</li><li>Виброплиты, трамбовки, вибраторы</li><li>Генераторы, стабилизаторы</li><li>Домкраты, рохли, такелаж</li><li>Дрели, шуруповерты, гайковёрты</li><li>Измерительный, нивелиры, тепловизор</li><li>Компрессоры, пистолеты, степлеры</li><li>Лестницы, вышки, когти</li><li>Мотобуры</li><li>Обогреватели, пушки, осушители</li><li>Перфораторы, отбойные молотки</li><li>Пилы, лобзики, реноваторы</li><li>Пылесосы, отпариватели, поломоечные</li><li>Рубанки, фрезеры</li><li>Ручной инструмент</li><li>Садовая техника, измельчители, триммеры</li><li>Сантехнический</li><li>Сварочные аппараты, паяльники</li><li>Специнструмент для автосервиса</li><li>Шлифмашины, болгарки, затирочные машины</li></ul><p><img src="'+e+'" alt=""></p>',19),p=[n];function c(d,_,u,h,g,m){return l(),t("div",null,p)}const b=i(s,[["render",c]]);export{k as __pageData,b as default};
